// Fun√ß√£o para extrair alimentos com valores nutricionais individuais
const extractFoodItemsWithNutrition = (text) => {
  const foodItems = [];

  // Lista de macronutrientes para EXCLUIR
  const macronutrients = ['calorias', 'prote√≠nas', 'carboidratos', 'gorduras', 'fibras', 'totais nutricionais'];

  // Padr√£o melhorado para capturar o formato espec√≠fico do prompt:
  // üçó **Frango:** 120g (165 kcal, 31g prot, 0g carb, 4g gord)
  const improvedFoodPattern = /([üçóüçùü•óüçñüçûü•ëüåæüçéü•ïü•¨üßÑü´òü•îüçÖüçöü•©üêüü•™üç≤ü•òüçõü•ôüåÆüåØü•ûüßáü•Øü•ñüçïüå≠üçîü•®ü•öüßÄü•õ])\s*\*\*([^:*]+):\*\*\s*([^(]+)\(([^)]+)\)/g;

  let match;
  while ((match = improvedFoodPattern.exec(text)) !== null) {
    const emoji = match[1];
    const name = match[2].trim();
    const quantity = match[3].trim();
    const nutritionText = match[4];

    // Verificar se N√ÉO √© um macronutriente
    const isFood = !macronutrients.some(macro => 
      name.toLowerCase().includes(macro.toLowerCase())
    );

    if (isFood) {
      // Extrair valores nutricionais do texto entre par√™nteses
      const calories = extractValueFromNutritionText(nutritionText, ['kcal', 'cal']);
      const protein = extractValueFromNutritionText(nutritionText, ['prot', 'prote√≠na']);
      const carbs = extractValueFromNutritionText(nutritionText, ['carb', 'carboidrato']);
      const fat = extractValueFromNutritionText(nutritionText, ['gord', 'gordura', 'fat']);
      const fiber = extractValueFromNutritionText(nutritionText, ['fibra', 'fiber']);

      foodItems.push({
        name: name,
        quantity: quantity,
        emoji: emoji,
        calories: calories,
        protein: protein,
        carbs: carbs,
        fat: fat,
        fiber: fiber
      });
    }
  }

  // Se n√£o encontrou com o padr√£o melhorado, usar o padr√£o antigo
  if (foodItems.length === 0) {
    const detailedFoodPattern = /([üçóüçùü•óüçñüçûü•ëüåæüçéü•ïü•¨üßÑü´òü•îüçÖüçöü•©üêüü•™üç≤ü•òüçõü•ôüåÆüåØü•ûüßáü•Øü•ñüçïüå≠üçîü•®ü•öüßÄü•õ])\s*\*\*([^:*]+):\*\*\s*([^\n]*?)(?:\((\d+)\s*kcal[^)]*\))?/g;

    while ((match = detailedFoodPattern.exec(text)) !== null) {
      const name = match[2].trim();
      const quantity = match[3].trim();
      const emoji = match[1];
      const calories = match[4] ? parseFloat(match[4]) : 0;

      // Verificar se N√ÉO √© um macronutriente
      const isFood = !macronutrients.some(macro => 
        name.toLowerCase().includes(macro.toLowerCase())
      );

      if (isFood) {
        // Tentar extrair valores nutricionais espec√≠ficos do texto do alimento
        const itemText = match[0];
        const itemProtein = extractNutrientFromItemText(itemText, 'protein');
        const itemCarbs = extractNutrientFromItemText(itemText, 'carbs');
        const itemFat = extractNutrientFromItemText(itemText, 'fat');
        const itemFiber = extractNutrientFromItemText(itemText, 'fiber');

        foodItems.push({
          name: name,
          quantity: quantity,
          emoji: emoji,
          calories: calories,
          protein: itemProtein,
          carbs: itemCarbs,
          fat: itemFat,
          fiber: itemFiber
        });
      }
    }
  }

  // Se ainda n√£o encontrou alimentos com emoji, procurar alimentos conhecidos no texto
  if (foodItems.length === 0) {
    const commonFoods = [
      { pattern: /\b(?:frango|chicken)\b/gi, name: 'Frango', emoji: 'üçó' },
      { pattern: /\b(?:macarr√£o|pasta|penne|espaguete)\b/gi, name: 'Macarr√£o', emoji: 'üçù' },
      { pattern: /\b(?:arroz|rice)\b/gi, name: 'Arroz', emoji: 'üçö' },
      { pattern: /\b(?:feij√£o|beans)\b/gi, name: 'Feij√£o', emoji: 'ü´ò' },
      { pattern: /\b(?:carne|meat|beef)\b/gi, name: 'Carne', emoji: 'ü•©' },
      { pattern: /\b(?:peixe|fish)\b/gi, name: 'Peixe', emoji: 'üêü' },
      { pattern: /\b(?:salada|salad)\b/gi, name: 'Salada', emoji: 'ü•ó' },
      { pattern: /\b(?:batata|potato)\b/gi, name: 'Batata', emoji: 'ü•î' }
    ];

    commonFoods.forEach(food => {
