// Fun√ß√£o para converter base64 para data URL se necess√°rio
function formatImageForOpenAI(imageData) {
  // Se j√° tem base64, usar diretamente
  if (imageData.base64) {
    // Garantir que est√° no formato data URL correto
    const base64Data = imageData.base64;
    const mimeType = imageData.mimetype || 'image/jpeg';

    // Se j√° est√° no formato data URL, retornar como est√°
    if (base64Data.startsWith('data:')) {
      return base64Data;
    }

    // Caso contr√°rio, criar data URL
